export default function Accueil() {
  const [listAnnonces, setListAnnonces] = useState([]);

  useEffect(() => {
    fetch("/annonces", {})
      .then((data) => data.json())
      .then((resultat) => {
        setListAnnonces(resultat);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <h1>Page d'accueil</h1>
    </div>
  );
}
